  min-height: 52px;
`;

const Place = styled.div`
  min-height: 22px;
  letter-spacing: 0;
`;

const Publications = styled.div`
  min-height: 22px;
  margin-top: 8px;
  letter-spacing: 0;
`;

export default Group13936;
